import React, { Component } from 'react';
import { Navbar, Nav } from 'react-bootstrap';

import './Nav.css';

class Navs extends Component {
    render() {
        return (
            <>
                <Navbar bg="primary" variant="light" className="bg-red" expand="lg">
                    <Navbar.Brand href="#home">
                        Matador MotorSports
                    {/* <img
                        src="/car.svg"
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                        alt="Matador MotorSports"
                    /> */}
                    </Navbar.Brand>
                </Navbar>  
            </>
        )
    }
}

export default Navs;
